  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:39.013915\",\n\t\"name\": \"kirwin-national-wildlife-refuge-narrative-report-january-december-1967\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kirwin
  National Wildlife Refuge outlines Refuge accomplishments during the 1967 calendar
  year.  The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, fish, and reptiles- is also covered. The Refuge development and
  maintenance section discusses physical developments, plantings, collections and
  receipts, vegetation control, prescribed burning, and wildfires. Resource management
  is outlined; topics include haying. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, hunting, violations, and safety. Items of interest,
  N-R forms, photographs, and newspaper articles are attached.\",\n\t\"license_title\":
